sympy.sympy.logic.boolalg.__eq__:
def __eq__(self, other):
    if other is True:
        return False
    if other is False:
        return True
    return super().__eq__(other)

sympy.sympy.matrices.utilities._iszero:
def _iszero(x: Expr) -> bool | None:
    """Returns True if x is zero."""
    return getattr(x, 'is_zero', None)
